    if (!this.lifeCycle[name]) {
        this.lifeCycle = LifeCycle[name] || this.lifeCycle;
        if (typeof this[name] === 'function') {
            this[name]();
        }

        // devtool
        // #[begin] devtool
        emitDevtool('comp-' + name, this);
        // #[end]
    }
